import { Switch, Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import Cards from "./components/Cards";
import Navbar from "./components/Navbar";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Navbar>
          <Cards></Cards>
        </Navbar>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
